// about.jsx
import React from "react";
import "../../styles/about.css";
import profileImage from "./img/about-me.png";

function AboutMe() {
  return (
    <section id="AboutMe" className="about-section">
      <div className="about-section-content">
        <div className="about-section-img">
          <img src={profileImage} alt="About Me" />
        </div>
        <div className="info-container">
          <div className="info-item">I am a web developer</div>
          <div className="info-item">Passionate about coding</div>
          <div className="info-item">Love learning new technologies</div>
          <div className="info-item">Enjoy problem-solving</div>
          <div className="info-item">Dedicated to creating great user experiences</div>
        </div>
      </div>
    </section>
  );
}

export default AboutMe;
